function botonContador({valorContador = 0}) {
  return (
    <div className = "contador">
        <h4>Valor: {valorContador}</h4>
        <button id="incrementa">Incrementar</button>  
        <button id="decrementar">Decrementar</button>      
    </div>
  );
}

export default Contador;
